commits.content:
"use client"; 

import Link from "next/link";
import Nav from "../Nav/Navbar"; // Assuming Nav is a custom component.
import MobileNav from "../MobileNav"; // Assuming MobileNav is a custom component.
import Image from "next/image"; 
import './Header.css'; // Import the custom CSS for this component

const Header = () => {
  return (
    <header className="header">
      <div className="container">

        {/* Link with Logo Image */}
        <Link href="/">
          <Image
            src="/logo.jpeg" 
            alt="Aliza Logo"
            width={115} 
            height={60}
            priority 
          />
        </Link>

        {/* Navbar */}
        <div className="navbar">
          <Nav />
          <Link href='/contact'>
            <button className="hire-button">Hire me</button>
          </Link>
        </div>

        {/* Mobile Nav */}
        <div className="mobile-nav"> 
           <MobileNav /> 
        </div>

      </div>
    </header>
  );
};

export default Header;
